import * as React from "react";
import { Image } from "expo-image";
import { StyleSheet, Text, View, Pressable } from "react-native";
// import { useNavigation } from "@react-navigation/native";
import { Color, FontFamily, FontSize } from "../GlobalStyles";

const SessionScreen = () => {
  // const navigation = useNavigation();

  return (
    <View style={[styles.x520, styles.x520Layout]}>
      <Image
        style={[styles.menuIcon, styles.menuIconPosition]}
        contentFit="cover"
        source={require("../assets/menu.svg")}
      />
      <Image
        style={styles.x520Child}
        contentFit="cover"
        source={require("../assets/ellipse-15.svg")}
      />
      <View style={[styles.groupParent, styles.menuIconPosition]}>
        <View style={styles.groupWrapper}>
          <View style={[styles.mySessionsWrapper, styles.wrapperPosition]}>
            <Text style={styles.mySessions}>My Sessions</Text>
          </View>
        </View>
        <View style={styles.groupContainer}>
          <View style={[styles.historyWrapper, styles.wrapperPosition]}>
            <Text style={[styles.history, styles.historyFlexBox]}>History</Text>
          </View>
        </View>
      </View>
      <View style={[styles.parent, styles.parentPosition]}>
        <Image
          style={styles.icon}
          contentFit="cover"
          source={require("../assets/no-session.svg")}
        />
        <Text
          style={[styles.youHaveNo, styles.historyFlexBox]}
        >{`You have no sessions yet ! `}</Text>
        <View style={styles.arrowLoop}>
          <View style={[styles.arrowLoopChild, styles.x520Layout]} />
          <Image style={styles.icon1} contentFit="cover" source={`->_4`} />
        </View>
      </View>
      <Pressable
        style={[styles.createNewSessionWrapper, styles.parentPosition]}
        onPress={() => {}}
      >
        <Text style={[styles.createNewSession, styles.historyFlexBox]}>
          + Create new Session
        </Text>
      </Pressable>
    </View>
  );
};

const styles = StyleSheet.create({
  x520Layout: {
    width: "100%",
    backgroundColor: Color.white,
  },
  menuIconPosition: {
    left: 46,
    position: "absolute",
  },
  wrapperPosition: {
    left: 0,
    top: 0,
    height: 14,
    position: "absolute",
  },
  historyFlexBox: {
    textAlign: "center",
    color: Color.black,
  },
  parentPosition: {
    alignItems: "center",
    left: "50%",
    position: "absolute",
  },
  menuIcon: {
    width: 18,
    height: 18,
    top: 55,
  },
  x520Child: {
    right: 46,
    width: 23,
    height: 23,
    top: 55,
    position: "absolute",
  },
  mySessions: {
    textAlign: "left",
    color: Color.black,
    fontFamily: FontFamily.manropeSemiBold,
    fontWeight: "600",
    fontSize: FontSize.size_2xs_4,
    left: 0,
    top: 0,
    height: 14,
    width: 75,
    position: "absolute",
  },
  mySessionsWrapper: {
    width: 75,
  },
  groupWrapper: {
    height: 14,
    width: 75,
  },
  history: {
    opacity: 0.5,
    width: 42,
    fontFamily: FontFamily.manropeSemiBold,
    fontWeight: "600",
    textAlign: "center",
    fontSize: FontSize.size_2xs_4,
    left: 0,
    top: 0,
    position: "absolute",
  },
  historyWrapper: {
    width: 42,
  },
  groupContainer: {
    marginLeft: 7.41,
    width: 42,
    height: 14,
  },
  groupParent: {
    top: 120,
    flexDirection: "row",
  },
  icon: {
    width: 163,
    height: 163,
    zIndex: 0,
    overflow: "hidden",
  },
  youHaveNo: {
    fontSize: 9,
    fontWeight: "500",
    fontFamily: FontFamily.manropeMedium,
    width: 146,
    height: 12,
    zIndex: 1,
    marginTop: 0.26,
  },
  arrowLoopChild: {
    height: "100%",
    top: "0%",
    right: "0%",
    bottom: "0%",
    left: "0%",
    position: "absolute",
  },
  icon1: {
    height: "32.2%",
    width: "33.39%",
    top: "18.52%",
    right: "31.32%",
    bottom: "49.28%",
    left: "35.29%",
    maxWidth: "100%",
    maxHeight: "100%",
    position: "absolute",
    overflow: "hidden",
  },
  arrowLoop: {
    marginLeft: -3.29,
    top: 196,
    width: 13,
    height: 20,
    zIndex: 2,
    left: "50%",
    position: "absolute",
  },
  parent: {
    marginLeft: -81.5,
    top: 188,
  },
  createNewSession: {
    fontFamily: FontFamily.rubikRegular,
    width: 152,
    fontSize: FontSize.size_2xs_4,
    textAlign: "center",
  },
  createNewSessionWrapper: {
    marginLeft: -134.83,
    bottom: 32,
    borderRadius: 74,
    borderStyle: "solid",
    borderColor: "#000",
    borderWidth: 0.7,
    height: 35,
    paddingHorizontal: 59,
    paddingVertical: 11,
    justifyContent: "center",
    flexDirection: "row",
    backgroundColor: Color.white,
    alignItems: "center",
  },
  x520: {
    flex: 1,
    height: 520,
    overflow: "hidden",
  },
});

export default SessionScreen;
